import React from 'react';
import { ProfileContainer, ProfileHeader } from '../Profile';

function Profile() {
  return (
    <ProfileContainer>
      <ProfileHeader>
        <h1>Hello</h1>
      </ProfileHeader>
    </ProfileContainer>
  );
}

export default Profile;
